import React from 'react';
import TextField from '@material-ui/core/TextField';

const InputItems = () => (<div>
  <TextField
        id="outlined-full-width"
        label="Label"
        style={{ margin: 8 }}
        placeholder="Placeholder"
        helperText="Full width!"
        fullWidth
        margin="normal"
        InputLabelProps={{
          shrink: true,
        }}
        variant="outlined"
      />
</div>);

export default InputItems;
